// Struct definitions for the json coming in from ETA
type Routes struct {
	GetRoutes []struct {
		ID    int      `json:"id"`
		Name  string   `json:"name"`
		Stops []string `json:"stops"`
	} `json:"get_routes"`
}
type Stops struct {
	GetStops []struct {
		ID   int     `json:"id"`
		Name string  `json:"name"`
		Lat  float64 `json:"lat"`
		Lng  float64 `json:"lng"`
	} `json:"get_stops"`
}

type Vehicles struct {
	GetVehicles []struct {
		Equipmentid        string      `json:"equipmentID"`
		Lat                float64     `json:"lat"`
		Lng                float64     `json:"lng"`
		Routeid            int         `json:"routeID"`
		Nextstopid         interface{} `json:"nextStopID"`
		Schedulenumber     string      `json:"scheduleNumber"`
		Inservice          int         `json:"inService"`
		Minutestonextstops []Minutestonextstops
		//Minutestonextstops interface{}
		Onschedule  interface{} `json:"onSchedule"`
		Receivetime int64       `json:"receiveTime"`
	} `json:"get_vehicles"`
}
type Minutestonextstops struct {
	StopID  int `json:"stopID"`
	Minutes int `json:"minutes"`
}
type BusInfo struct {
	Routeid     int         `json:"routeID"`
	Equipmentid string      `json:"equipmentID"`
	Lat         float64     `json:"lat"`
	Lng         float64     `json:"lng"`
	Nextstopid  interface{} `json:"nextStopID"`
	Inservice   bool        `json:"inService"`
}
type StopInfo struct {
	ID           int     `json:"id"`
	Name         string  `json:"name"`
	Nextbustimes []int   `json:"nextBusTimes"`
	Lat          float64 `json:"lat"`
	Lng          float64 `json:"lng"`
}
type RouteInfo struct {
	ID    int    `json:"id"`
	Name  string `json:"name"`
	Stops []int  `json:"stops"`
}
type FinalPackage struct {
	BusInfo   []BusInfo
	StopInfo  []StopInfo
	RouteInfo []RouteInfo
}
type FinalCreator struct {
	Routes Routes
	Stops  Stops
	Buses  Vehicles
}
type Client struct {
	Url string
}

// Lets make this into an interface so we can make great testable code
type Caller interface {
	CallToTheJerks() []byte
}
type Creator interface {
	CreateFinalJson() (*[]byte, error)
}

// Have some setters because why not :)
func (bi *BusInfo) SetBusInfo(Routeid int, Equipmentid string, Lat float64, Lng float64, Nextstopid interface{}, Inservice bool) {
	bi.Routeid = Routeid
	bi.Equipmentid = Equipmentid
	bi.Lat = Lat
	bi.Lng = Lng
	bi.Nextstopid = Nextstopid
	bi.Inservice = Inservice
	//bi.Minutestonextstops = Minutestonextstops
}
func (ri *RouteInfo) SetRouteInfo(Id int, Name string, Stops []int) {
	ri.ID = Id
	ri.Name = Name
	ri.Stops = Stops
}
func (si *StopInfo) SetStopInfo(Id int, Name string, Nextbustimes []int, Lat float64, Lng float64) {
	si.ID = Id
	si.Name = Name
	si.Nextbustimes = Nextbustimes
	si.Lat = Lat
	si.Lng = Lng
}
func (mtns Minutestonextstops) SetMinutesToNextStop(StopID int, Minutes int) {
	mtns.StopID = StopID
	mtns.Minutes = Minutes
}

// This makes the Final Creator struct which will then make the call
func CreateFinalCreator() FinalCreator {
	routes := Routes{}
	stops := Stops{}
	buses := Vehicles{}

	client := Client{Url: ROUTES_URL}
	routesBody, err := client.CallToTheJerks()
	if err != nil {
		// log.Fatal(err)
	}
	client2 := Client{Url: BUSES_URL}
	busesBody, err1 := client2.CallToTheJerks()
	if err1 != nil {
		// log.Fatal(err1)
	}
	client3 := Client{Url: STOPS_URL}
	stopsBody, err2 := client3.CallToTheJerks()
	if err2 != nil {
		// log.Fatal(err2)
	}

	error := json.Unmarshal(routesBody, &routes)
	if error != nil {
		// log.Fatal(error)
	}
	stoperror := json.Unmarshal(stopsBody, &stops)
	if stoperror != nil {
		// log.Fatal(stoperror)
	}
	buserror := json.Unmarshal(busesBody, &buses)
	if buserror != nil {
		//log.Fatal("hi3: ", buserror)
	}

	return FinalCreator{Routes: routes, Stops: stops, Buses: buses}
}

// Makes the call to the ETA jerks and returns the byte slice of json
func (c Client) CallToTheJerks() ([]byte, error) {
	//log.Println("Making call to: ", c.Url)
	req, err := http.NewRequest("GET", c.Url, nil)
	if err != nil {
		return nil, err
	}
	req.Header.Set("User-Agent", "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_1) AppleWebKit/600.1.25 (KHTML, like Gecko) Version/8.0 Safari/600.1.25")

	client := &http.Client{}
	resp, err := client.Do(req)
	if err != nil {
		return nil, err
	}
	defer resp.Body.Close()

	if resp.StatusCode != http.StatusOK {
		fmt.Println("Response did not return 200. Status received: ", resp.Status)
		fmt.Println("On this request: ", resp.Request)
		return nil, err
	}

	body, err1 := ioutil.ReadAll(resp.Body)
	if err1 != nil {
		return nil, err1
	}

	return body, nil
}

// Creates the final json to be served by the server
func (fc FinalCreator) CreateFinalJson() ([]byte, []byte, []byte, error) {

	var service bool
	var nextstopid interface{}

	routeCollection := []RouteInfo{}
	stopCollection := []StopInfo{}
	busCollection := []BusInfo{}

	busInfo := BusInfo{}
	stopInfo := StopInfo{}
	routeInfo := RouteInfo{}
	for _, route := range fc.Routes.GetRoutes {
		var stopToInt []int
		for _, stop := range route.Stops {
			stopAsInt, err := strconv.Atoi(stop)
			if err != nil {
				//log.Fatal(err)
			}
			stopToInt = append(stopToInt, stopAsInt)
		}
		routeInfo.SetRouteInfo(route.ID, route.Name, stopToInt)
		routeCollection = append(routeCollection, routeInfo)
	}
	//NEED to optomize this....  :(
	for _, stop := range fc.Stops.GetStops {
		var nextbustimes []int
		for _, bus := range fc.Buses.GetVehicles {
			if len(bus.Minutestonextstops) != 0 {
				for _, minute := range bus.Minutestonextstops {
					if minute.StopID == stop.ID && minute.Minutes >= 0 {
						nextbustimes = append(nextbustimes, minute.Minutes)
					}
				}
			}
		}

		sort.Ints(nextbustimes)

		if strings.EqualFold(stop.Name, "Euclid") {
			stop.Name = "UMC"
		}

		if !strings.EqualFold(stop.Name, "30th and Colorado E Bound") && !strings.EqualFold(stop.Name, "30th and Colorado WB") {
			stopInfo.SetStopInfo(stop.ID, stop.Name, nextbustimes, stop.Lat, stop.Lng)
			stopCollection = append(stopCollection, stopInfo)
		}

	}
	for _, bus := range fc.Buses.GetVehicles {
		if bus.Inservice == 0 {
			service = false
		} else {
			service = true
		}
		if bus.Nextstopid == nil {
			nextstopid = -200
		} else {
			nextstopid = bus.Nextstopid
		}
		busInfo.SetBusInfo(bus.Routeid, bus.Equipmentid, bus.Lat, bus.Lng, nextstopid, service)
		busCollection = append(busCollection, busInfo)
	}

	busJson, err := json.Marshal(busCollection)
	if err != nil {
		fmt.Println("Error Marshalling the JSON for the Audit", err)
		return nil, nil, nil, err
	}
	stopJson, err := json.Marshal(stopCollection)
	if err != nil {
		fmt.Println("Error Marshalling the JSON for the Audit", err)
		return nil, nil, nil, err
	}
	routeJson, err := json.Marshal(routeCollection)
	if err != nil {
		fmt.Println("Error Marshalling the JSON for the Audit", err)
		return nil, nil, nil, err
	}

	return busJson, stopJson, routeJson, nil
}
